import {Route} from 'react-router-dom'

class Main extends Component{
  constructor(){
    super()


  }


  render(){
    return (
      <div>
        <Route exact path="/" render={()=> (
          <div>
              <Title title={"PhotoWall"}/>
              {/*<Photowall posts={this.state.posts} onRemovePhoto={this.removePhoto}/>*/}
          </div>
        )}/>


      </div>
    )
  }
}

export default Main;
